/** 
 * This method shows dialog with given title & message. Also there is an option to pass onClickListener for positive & negative button.
 * @param title                         - dialog title
 * @param message                       - dialog message
 * @param onPositiveButtonClickListener - listener for positive button
 * @param positiveText                  - positive button text
 * @param onNegativeButtonClickListener - listener for negative button
 * @param negativeText                  - negative button text
 */
protected void showAlertDialog(@Nullable String title,@Nullable String message,@Nullable DialogInterface.OnClickListener onPositiveButtonClickListener,@NonNull String positiveText,@Nullable DialogInterface.OnClickListener onNegativeButtonClickListener,@NonNull String negativeText){
  AlertDialog.Builder builder=new AlertDialog.Builder(this);
  builder.setTitle(title);
  builder.setMessage(message);
  builder.setPositiveButton(positiveText,onPositiveButtonClickListener);
  builder.setNegativeButton(negativeText,onNegativeButtonClickListener);
  mAlertDialog=builder.show();
}
